import React from 'react'
import './Navbar.css'
function Navbar() {
    return (
       <div className = "nav">
           <div className = "nav-brand">
               <img src="https://cdn.freebiesupply.com/logos/large/2x/netflix-2-logo-png-transparent.png" alt="" />
           </div>
            <button className ="sign-btn">Sign in</button>
       </div>
    )
}

export default Navbar
